import React from 'react';
import ReactWeather from 'react-open-weather';
import { Card } from 'react-bootstrap';

function CurrentWeather(props) {
    return (
        <Card>
            <Card.Body>
                <ReactWeather
                    forecast="today"
                    apikey="8c3e7fd0f6ec033c8ecf4379bb4cce9d"
                    type="city"
                    city="Munich"/>
            </Card.Body>
        </Card>
    );
}

export default CurrentWeather;
